import axios from "axios";

class usernameget extends React.Component{
    state = {
        firstName: '',
        lastName: ''
    };

    render(){

        axios.get('http://localhost:3010/getname')
            .then(function (response) {
                // handle success
                this.setState({
                    firstName : response.data
                })


            })
            .catch(function (error) {
                // handle error
                console.log(error);
            })
        console.log("insidetestingstore")
        console.log(this.state.firstName)
        return this.state.firstName
    }
    

}
